import {FormControlLabel, Radio, RadioGroup} from "@material-ui/core";
import React, {useEffect, useState} from "react";
import '../styles/components.css';
import {RadioType} from "../objects/enums/RadioType";

const RadioConfigGroup = ({type: RadioType}) => {
    const [texts, setTexts] = useState(["","","",""])<string[]>;

    const getTextsByType = () => {
        switch (RadioType){
            case RadioType.OPERATION:
                return ["XD","XD","XD","XD"]
            case RadioType.TYPE:
                return ["DXD","DXD","DXD","DXD"]
            case RadioType.QUANTITY:
                return ["XDD","XDD","XDD","XDD"]
        }
    }

    useEffect(() => {
        setTexts(getTextsByType())
    })

    return (
        <div>
            <text className='radioTitle'>Twoja Matka</text>
            <RadioGroup>
                <FormControlLabel control={<Radio color="secondary"/>} label={"POST"}/>
                <FormControlLabel control={<Radio/>} label={"GET"}/>
                <FormControlLabel control={<Radio/>} label={"CHUJ"}/>
                <FormControlLabel control={<Radio/>} label={"CIPA"}/>
            </RadioGroup>
        </div>
    );
}

export default RadioConfigGroup;
